///////////////////////////// Données ESA           ////////////            //////////////       ////////////

///////////////////////////// carte           ////////////            //////////////       ////////////

 async function MapESA() {
    const response = await fetch(DonneESA);
    const donne = await response.json();
    const data = donne.Candidat;


    var map = L.map('map').setView([50.414418, 10.104369], 3);

    L.tileLayer('https://{s}.basemaps.cartocdn.com/dark_all/{z}/{x}/{y}{r}.png', {
        maxZoom: 20,
    }).addTo(map);


    var Pcandidat = L.icon({
        iconUrl: '../images/PointeurCandidat.svg',

        iconSize:     [20, 40], // size of the icon
        iconAnchor:   [10, 40], // point of the icon which will correspond to marker's location
        popupAnchor:  [0, -40] // point from which the popup should open relative to the iconAnchor
    });

    
    for (let i = 0; i < data.length; i++) {
        L.marker([data[i].Coordonée[0],data[i].Coordonée[1]], {icon: Pcandidat}).addTo(map).bindPopup(`<div class='Tpopup'>${data[i].Pays} : ${data[i].Homme+data[i].Femme} candidats</div> <div class='Pbox'><div class='Rpopup'>${data[i].Homme} hommes</div>  <div class='Rpopup'>${data[i].Femme} femmes</div></div> `);
    }
} 


MapESA();
